INSERT INTO `y8nhj_content` VALUES (1,34,'Populp Login','populp-login','','<p>{loadposition popup}</p>','',1,0,0,2,'2012-04-13 13:58:28',42,'','0000-00-00 00:00:00',0,0,'0000-00-00 00:00:00','2012-04-13 13:58:28','0000-00-00 00:00:00','','','{\"show_title\":\"\",\"link_titles\":\"\",\"show_intro\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_layout\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}',1,0,5,'','',1,1,'{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}',0,'*',''),(2,37,'Certification  Program','certification-program','','<p>\r\n	This certification program allows student to discover and learn the Natural Science Studies and Practices which dates back Primordial Ancient Period with the support of scientific evidence. This internationally-registered, interactive learning program focus on scientifically sound and evidence-based studies on how the mind influences time.</p>\r\n','\r\n<table border=\"0\" cellpadding=\"1\" cellspacing=\"0\" style=\"width: 32px;\">\r\n	<tbody>\r\n		<tr>\r\n			<td>\r\n				<img alt=\"\" src=\"images/certification_program_full.png\" style=\"width: 604px; height: 307px;\" /></td>\r\n			<td style=\"padding-left:20px\">\r\n				<img alt=\"\" src=\"images/logo_transcendental.png\" style=\"width: 320px; height: 257px;\" /></td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n<p>\r\n	&nbsp;</p>\r\n<div>\r\n	This certification program allows student to discover and learn the Natural Science Studies and Practices which dates back Primordial Ancient Period with the support of scientific evidence. This internationally-registered, interactive learning program focus on scientifically sound and evidence-based studies on how the mind influences time, space and matters around us. Many established and acclaimed scientists attest to such experimental phenomenon.</div>\r\n<div>\r\n	&nbsp;</div>\r\n<div>\r\n	Graduates use their newly-learned technical skills for:</div>\r\n<div>\r\n	&nbsp;</div>\r\n<ul>\r\n	<li>\r\n		Determining the causes and the correct resolution of health challenges in fastest time frame</li>\r\n	<li>\r\n		Amplifying Self Healing and Healing process</li>\r\n	<li>\r\n		Shifting probabilities of living outcomes</li>\r\n	<li>\r\n		Enhancing Intuition to avoid danger and making wrong decisions for oneself and others</li>\r\n	<li>\r\n		Influencing the Quantum energetic state of matters and environment around us.</li>\r\n	<li>\r\n		Differentiating the quality of energetics and health care products claims.</li>\r\n	<li>\r\n		Create effective healing programs for 3rd parties based on all the ancient holistic healing learnt.</li>\r\n</ul>\r\n<div>\r\n	<p>\r\n		<strong open=\"\" style=\"color: #7a7a7b; text-transform: uppercase; font-size: 25px; font-family: \'Open Sans\';\">SCIENTIFIC BASIS</strong></p>\r\n	<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" style=\"width: 100%\">\r\n		<tbody>\r\n			<tr>\r\n				<td style=\"width: 50px;\">\r\n					<img alt=\"\" src=\"images/icon_quote.png\" style=\"width: 65px; height: 50px;\" /></td>\r\n				<td style=\"color: rgb(101, 101, 101); font-style: italic;\">\r\n					Now....to me, what you call a miracle, is just an expected outcome from applying a level of natural science and technology to a situation that is so far beyond the orthodox paradigm of a society that it boggles the mind of orthodox practitioners.</td>\r\n			</tr>\r\n			<tr>\r\n				<td align=\"right\" colspan=\"2\" style=\"font-weight:bold\">\r\n					Professor Emeritus William A. Tiller, Ph.D.<br />\r\n					<span style=\"color:#7c85fa\">Dept of Materials Science, Stanford University</span></td>\r\n			</tr>\r\n		</tbody>\r\n	</table>\r\n	<p>\r\n		&nbsp;</p>\r\n	<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" style=\"width: 100%;\">\r\n		<tbody>\r\n			<tr>\r\n				<td style=\"width: 50px;\">\r\n					<img alt=\"\" src=\"images/icon_quote.png\" style=\"width: 65px; height: 50px;\" /></td>\r\n				<td style=\"color: rgb(101, 101, 101); font-style: italic;\">\r\n					On the Double-Slit Experiment: &quot;...a phenomenon which is impossible ... to explain in any classical way, and which has in it the heart of quantum mechanics. In reality, it contains the only mystery [of quantum mechanics</td>\r\n			</tr>\r\n			<tr>\r\n				<td align=\"right\" colspan=\"2\" style=\"font-weight:bold\">\r\n					Professor Richard P. Feynman, Nobel Laureate,<br />\r\n					<span style=\"color:#7c85fa\">California Institute of Technology</span></td>\r\n			</tr>\r\n		</tbody>\r\n	</table>\r\n	<p>\r\n		&nbsp;</p>\r\n	<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" style=\"width: 100%\">\r\n		<tbody>\r\n			<tr>\r\n				<td style=\"width: 50px;\">\r\n					<img alt=\"\" src=\"images/icon_quote.png\" style=\"width: 65px; height: 50px;\" /></td>\r\n				<td style=\"color: rgb(101, 101, 101); font-style: italic;\">\r\n					On Morphogenetic Fields: &quot;The idea is that there is a kind of memory in nature. Each kind of thing has a collective memory. So, take a squirrel living in New York now. That squirrel is being influenced by all past squirrels.</td>\r\n			</tr>\r\n			<tr>\r\n				<td align=\"right\" colspan=\"2\" style=\"font-weight:bold\">\r\n					Professor Rupert Sheldrake<br />\r\n					<span style=\"color:#7c85fa\">Biology Dept. Cambridge University</span></td>\r\n			</tr>\r\n		</tbody>\r\n	</table>\r\n</div>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	<strong open=\"\" style=\"color: rgb(122, 122, 123); text-transform: uppercase; font-size: 25px; font-family: \'Open Sans\';\">SCIENTIFIC BASIS</strong></p>\r\n<p>\r\n	<strong open=\"\" style=\"color: #959595; text-transform: uppercase; font-size: 25px; font-family: \'Open Sans\';\">Level 1 to 2 - Foundation.&nbsp;</strong></p>\r\n<div>\r\n	Foundation level 1 is also available as online <strong>HOME STUDY</strong>.</div>\r\n<div>\r\n	&nbsp;</div>\r\n<div>\r\n	The Foundation Program is a highly practical, technical skills-based course for self empowerment, healing and mastering the foundation of Metaphysics art and science. It provides a strong and complete foundation for anyone who has the inclination to learn true metaphysics knowledge and technologies and to embark on a life path in serving and healing others. At the end of the program, students will be empowered towards knowing who they are, how they can unleash their hidden abilities to create new outcomes for themselves and others.</div>\r\n<div>\r\n	&nbsp;</div>\r\n<div>\r\n	<strong><img alt=\"\" src=\"images/certification_program_1.png\" style=\"width: 468px; height: 307px; float: right;\" />Level 1</strong></div>\r\n<div>\r\n	&nbsp;</div>\r\n<ul>\r\n	<li>\r\n		Biophysical Medicine techniquesemployee 2</li>\r\n	<li>\r\n		Psycho-Energetics Science I</li>\r\n	<li>\r\n		Old Metaphysics vs New Metaphysics I</li>\r\n	<li>\r\n		Historical Astrology vs Quantum Fractal Scaling I</li>\r\n	<li>\r\n		Origin of Life I</li>\r\n	<li>\r\n		Scientific Evidence &amp; Supporting Documents I</li>\r\n</ul>\r\n<div>\r\n	&nbsp;</div>\r\n<div>\r\n	<strong>Level 2</strong></div>\r\n<div>\r\n	&nbsp;</div>\r\n<ul>\r\n	<li>\r\n		Biophysical Medicine techniques</li>\r\n	<li>\r\n		Psycho-Energetics Science II</li>\r\n	<li>\r\n		Old Metaphysics vs New Metaphysics II</li>\r\n	<li>\r\n		Historical Astrology vs Quantum Fractal Scaling II</li>\r\n	<li>\r\n		Origin of Life II</li>\r\n	<li>\r\n		Scientific Evidence &amp; Supporting Documents II</li>\r\n	<li>\r\n		Learn Time-Space Entanglement</li>\r\n</ul>\r\n<div>\r\n	&nbsp;</div>\r\n<div>\r\n	<strong>Level 3 - Licensing Program to be certified as an Applied Metaphysics Researcher.</strong></div>\r\n<div>\r\n	&nbsp;</div>\r\n<div>\r\n	Thereafter completion of the Foundation Program and fulfilling certain criteria that will only come about after mutual discussion with student.</div>\r\n<div>\r\n	&nbsp;</div>\r\n<div>\r\n	<center>\r\n		<table border=\"0\" cellpadding=\"1\" cellspacing=\"1\" style=\"width: 600px;\">\r\n			<tbody>\r\n				<tr>\r\n					<td align=\"center\" width=\"210px\">\r\n						<strong>Order your Hardcopy Book here!</strong></td>\r\n					<td width=\"100%\">\r\n						&nbsp;</td>\r\n					<td align=\"center\">\r\n						<strong>Order Your eBook here!</strong></td>\r\n				</tr>\r\n				<tr>\r\n					<td align=\"center\" style=\"padding:15px 0 0 0;\">\r\n						<img alt=\"\" src=\"images/founder_effect.png\" style=\"width: 215px; height: 240px;\" /></td>\r\n					<td>\r\n						&nbsp;</td>\r\n					<td align=\"center\" style=\"padding:15px 0 0 0;\">\r\n						<img alt=\"\" src=\"images/founder_effect.png\" style=\"width: 215px; height: 240px;\" /></td>\r\n				</tr>\r\n				<tr>\r\n					<td style=\"padding:0 0 0 20px;\" width=\"210px\">\r\n						<strong>From </strong><a href=\"http://Amazon.com\" target=\"_blank\">Amazon.com</a></td>\r\n					<td>\r\n						&nbsp;</td>\r\n					<td style=\"padding:0 0 0 20px;\">\r\n						<div>\r\n							<strong>From </strong><a href=\"http://Amazon.com\" target=\"_blank\">Amazon.com</a></div>\r\n						<div>\r\n							<strong>From </strong>Smashwords eBooks</div>\r\n						<div>\r\n							<strong>From </strong>iTunes</div>\r\n					</td>\r\n				</tr>\r\n			</tbody>\r\n		</table>\r\n	</center>\r\n</div>\r\n<p>\r\n	&nbsp;</p>\r\n<div>\r\n	<p>\r\n		<strong open=\"\" style=\"color: rgb(122, 122, 123); text-transform: uppercase; font-size: 25px; font-family: \'Open Sans\';\">TESTIMONIALS</strong></p>\r\n	<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" style=\"width: 100%\">\r\n		<tbody>\r\n			<tr>\r\n				<td colspan=\"2\" open=\"\" style=\"text-transform: u