ing and scientifically-backed account of people like John Wong, who defied the odds and went against conventional medical wisdom to emerge triumphant in a face-off with death. A must-read for those who wish to keep in good health and maintain their vitality, youth and vigor by simply changing the way they see the world around them. This book has reminded me that all of life, including my body, is a spectacular miracle. I highly recommend this book!</td>\r\n			</tr>\r\n			<tr>\r\n				<td align=\"right\" colspan=\"2\" style=\"font-weight: bold;\">\r\n					DR MEL GILL, <span style=\"color:#7c85fa\">author of the international bestseller The Meta Secret</span></td>\r\n			</tr>\r\n		</tbody>\r\n	</table>\r\n</div>\r\n','',1,0,0,7,'2014-05-07 10:08:27',42,'','2014-05-07 10:28:12',42,0,'0000-00-00 00:00:00','2014-05-07 10:08:27','0000-00-00 00:00:00','{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}','{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}','{\"show_title\":\"\",\"link_titles\":\"\",\"show_intro\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_layout\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}',1,0,9,'','',1,0,'{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}',0,'*',''),(18,57,'Wes heiser','wes-heiser','','<div>\r\n	<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" style=\"width: 100%;\">\r\n		<tbody>\r\n			<tr>\r\n				<td style=\"width: 50px;\" valign=\"top\">\r\n					<img alt=\"\" src=\"images/icon_quote.png\" style=\"width: 65px; height: 50px;\" /></td>\r\n				<td style=\"color: rgb(101, 101, 101); font-style: italic;\">\r\n					I had severe pain in my neck and numbness down my right arm that worsened over a 3 year period until I could no longer tolerate it and consulted an osteopath and 2 neurosurgeons. MRI showed 2 slipped disks and calcification that pinched off the nerves. All said neck surgery is mandatory to recover. I was inspired by your talks at Kampung Senang and I read your book. I decided to take responsibility for myself and visualize that I heal myself. Soon after I started, my pain and numbness diminished to zero. It&#39;s been 3 continuous months without pain. Next year I plan another MRI to see if there is measurable physical improvement. Thank you for inspiring me to heal myself.</td>\r\n			</tr>\r\n			<tr>\r\n				<td align=\"right\" colspan=\"2\" style=\"font-weight: bold;\">\r\n					Wes Heiser, <span style=\"color:#7c85fa\">USA</span></td>\r\n			</tr>\r\n		</tbody>\r\n	</table>\r\n</div>\r\n','',1,0,0,7,'2014-05-07 10:10:21',42,'','2014-05-07 10:28:12',42,0,'0000-00-00 00:00:00','2014-05-07 10:10:21','0000-00-00 00:00:00','{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}','{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}','{\"show_title\":\"\",\"link_titles\":\"\",\"show_intro\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_layout\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}',1,0,10,'','',1,0,'{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}',0,'*',''),(19,58,'Stephanie milani theng','stephanie-milani-theng','','<div>\r\n	<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" style=\"width: 100%;\">\r\n		<tbody>\r\n			<tr>\r\n				<td style=\"width: 50px;\" valign=\"top\">\r\n					<img alt=\"\" src=\"images/icon_quote.png\" style=\"width: 65px; height: 50px;\" /></td>\r\n				<td style=\"color: rgb(101, 101, 101); font-style: italic;\">\r\n					One word to sum up my feelings so far: wow. I am shocked. You&#39;ve described your Experiences and ordeals SO vividly and honestly... Its hard not to get absorbed and to think abt how and what happened when such an illness is so intimate... Thank you for your courage and in sharing with us. Thanks for being real.</td>\r\n			</tr>\r\n			<tr>\r\n				<td align=\"right\" colspan=\"2\" style=\"font-weight: bold;\">\r\n					Stephanie Milani Theng, <span style=\"color:#7c85fa\"> Indoneisa</span></td>\r\n			</tr>\r\n		</tbody>\r\n	</table>\r\n</div>\r\n','',1,0,0,7,'2014-05-07 10:12:16',42,'','2014-05-07 10:28:12',42,0,'0000-00-00 00:00:00','2014-05-07 10:12:16','0000-00-00 00:00:00','{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}','{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}','{\"show_title\":\"\",\"link_titles\":\"\",\"show_intro\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_layout\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}',1,0,11,'','',1,0,'{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}',0,'*',''),(20,59,'Shan lim','shan-lim','','<div>\r\n	<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" style=\"width: 100%;\">\r\n		<tbody>\r\n			<tr>\r\n				<td style=\"width: 50px;\" valign=\"top\">\r\n					<img alt=\"\" src=\"images/icon_quote.png\" style=\"width: 65px; height: 50px;\" /></td>\r\n				<td style=\"color: rgb(101, 101, 101); font-style: italic;\">\r\n					When my father was warded in the hospital for a heart attack, I called John and asked him what I could do on my part to help my father. John shared that I could help my father by praying for his life energy to increase. Fortunately, I heeded John&rsquo;s advice and my father&rsquo;s condition did indeed improve. I strongly believe that having faith in prayers gave my family and me the extra boost that we needed. John&rsquo;s sharing on how we should pray from the heart continues to make a difference in our lives.</td>\r\n			</tr>\r\n			<tr>\r\n				<td align=\"right\" colspan=\"2\" style=\"font-weight: bold;\">\r\n					SHAN LIM, <span style=\"color:#7c85fa\">author of How Do Ordinary People Achieve Extraordinary Dreams</span></td>\r\n			</tr>\r\n		</tbody>\r\n	</table>\r\n</div>\r\n','',1,0,0,7,'2014-05-07 10:13:32',42,'','2014-05-07 10:28:12',42,0,'0000-00-00 00:00:00','2014-05-07 10:13:32','0000-00-00 00:00:00','{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}','{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}','{\"show_title\":\"\",\"link_titles\":\"\",\"show_intro\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_layout\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}',1,0,12,'','',1,0,'{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}',0,'*',''),(21,60,'Betty l khoo-kingsley','betty-l-khoo-kingsley','','<div>\r\n	<p>\r\n		<strong>John Wong has written the most important book I have read this decade.</strong></p>\r\n	<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" style=\"width: 100%;\">\r\n		<tbody>\r\n			<tr>\r\n				<td style=\"width: 50px;\" valign=\"top\">\r\n					<img alt=\"\" src=\"images/icon_quote.png\" style=\"width: 65px; height: 50px;\" /></td>\r\n				<td style=\"color: rgb(101, 101, 101); font-style: italic;\">\r\n					Why? Because John&rsquo;s experience reveals/affirms that the root of all illnesses begins in the mind&hellip;his young mind was filled with anger and resentment which boiled over to acts of violence. Then, as John entered his 30s, his angst &amp; ambition, coupled with his relentless drive to succeed in his bio-medical career, led to his paralysis and blindness. His body simply shut down. The medical experts in Singapore&rsquo;s General Hospital were completely baffled. They treated him blindly &ndash; even giving him chemotherapy &ndash; in the end they told John that there was nothing medical science could do for him. Only a miracle could make him walk and see again. And John created his own Miracle! In his darkest hours John made what he calls a &lsquo;Transcendental Connection&reg;&rsquo; with his Creator (the God source) by &ldquo;going within&rdquo;&hellip;Since hope of healing from without (i.e doctors &amp; drugs) was gone, he was forced to fall back on himself. With a body emanciated and crumpled with pain, John had only his mind to journey within. As he began soul-searching, probing deep within, he realized the pain and hurt he had caused his parents&hellip;and he was truly penitent. Bingo! that was the breakthrough&hellip;just as his sickness had been caused by his anger &amp; ambition filled mind, now his genuine remorse was triggering healing in every cell. And, just as importantly, as John turned the corner, he vowed that he would use his experience to help others who are suffering and to repay his parents for their unwavering care and faith in him. He had found his purpose for recovery&hellip; And this book tells very heart-warming stories of the people he started helping, even as he himself was struggling to regain his full strength. There are vitally important lessons for all of us in John&rsquo;s story.</td>\r\n			</tr>\r\n			<tr>\r\n				<td align=\"right\" colspan=\"2\" style=\"font-weight: bold;\">\r\n					Betty L Khoo-Kingsley, <span style=\"color:#7c85fa\"> Author: Cancer Cured &amp; Prevented, Naturally (3rd edition)</span></td>\r\n			</tr>\r\n		</tbody>\r\n	</table>\r\n</div>\r\n','',1,0,0,7,'2014-05-07 10:15:07',42,'','2014-05-07 10:28:12',42,0,'0000-00-00 00:00:00','2014-05-07 10:15:07','0000-00-00 00:00:00','{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\