em-ipsum-dolor-sit-amet-2&catid=8:events\";s:5:\"title\";s:28:\"Lorem ipsum dolor sit amet 2\";s:11:\"description\";s:124:\"Lorem ipsum dolor sit amet, consectetur adipisicing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua.\";s:9:\"published\";N;s:5:\"state\";i:1;s:6:\"access\";s:1:\"1\";s:8:\"language\";s:1:\"*\";s:18:\"publish_start_date\";s:19:\"2014-05-06 14:17:40\";s:16:\"publish_end_date\";s:19:\"0000-00-00 00:00:00\";s:10:\"start_date\";s:19:\"2014-05-06 14:17:40\";s:8:\"end_date\";s:19:\"0000-00-00 00:00:00\";s:10:\"list_price\";N;s:10:\"sale_price\";N;s:7:\"type_id\";i:3;}'),(82,'index.php?option=com_content&view=article&id=3','index.php?option=com_content&view=article&id=3:founder&catid=2:uncategorised&Itemid=116','Founder','In December 2004, at the peak of a distinguished career in the life sciences industry, John was struck down by a mysterious illness. He suffered total paralysis from the neck down and near total blindness due to extensive nerve and axonal damage. Some of ','2014-05-07 12:51:36','862c3cb7ad1c235d3b2f11f89084c982',1,1,1,'*','2014-05-06 04:30:28','0000-00-00 00:00:00','2014-05-06 04:30:28','0000-00-00 00:00:00',0,0,3,'O:19:\"FinderIndexerResult\":18:{s:11:\"\0*\0elements\";a:24:{s:2:\"id\";s:1:\"3\";s:5:\"alias\";s:7:\"founder\";s:7:\"summary\";s:352:\"<p>\r\n	In December 2004, at the peak of a distinguished career in the life sciences industry, John was struck down by a mysterious illness. He suffered total paralysis from the neck down and near total blindness due to extensive nerve and axonal damage. Some of his internal organs were badly affected and malfunctioned for a period of time.&nbsp;</p>\r\n\";s:4:\"body\";s:6925:\"\r\n<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" style=\"width: 100%;\">\r\n	<tbody>\r\n		<tr>\r\n			<td>\r\n				<p>\r\n					<img alt=\"\" src=\"images/founder_full.png\" style=\"width: 603px; height: 307px;\" /></p>\r\n			</td>\r\n			<td style=\"color:#949494; font-size:19px; padding:0 0 0 20px; text-transform:uppercase;font-family: \'Open Sans\', sans-serif;\">\r\n				<p>\r\n					AWAKEN YOUR HEALING POWER&trade;</p>\r\n				<p>\r\n					The Science Of Human Bio-Quantum Wellness.</p>\r\n				<p>\r\n					The Art Of Self-Regeneration and Peak Performance</p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	<img alt=\"\" src=\"images/founder_effect.png\" style=\"float: right; width: 215px; height: 240px; padding-top: 15px;\" />In December 2004, at the peak of a distinguished career in the life sciences industry, John was struck down by a mysterious illness. He suffered total paralysis from the neck down and near total blindness due to extensive nerve and axonal damage. Some of his internal organs were badly affected and malfunctioned for a period of time. Medically speaking, nerves cannot recover and re-grow by themselves once the axonal core is severely damaged. Despite undergoing numerous tests, the doctors were unable to diagnose with certainty the cause of this illness. He was coined a Medical Mystery by many.</p>\r\n<p>\r\n	Physicians, therapists, social workers and friends did not believe he could go back to his stressful corporate life. Nobody even believed that he will ever recover enough to walk, see, work and drive again. But not only did he return to a hectic corporate management life in the business sector, he further managed a team of scientists and contributed much to the growth of a number of companies. Now he is an entrepreneur and health coach.</p>\r\n<p>\r\n	What happened? Using his scientific knowledge, John discovered bit by bit 5 scientifically studied and proven keys in life to regenerate his body and battle his own incurable medical condition. Not only did he recover and help others to do so, he later realised that this specific rejuvenation process has also enabled him to achieve peak performance in his career, health and life in general.</p>\r\n<div>\r\n	<p>\r\n		John has since been featured on TV, radio, national newspapers and magazines around the world, telling people his remarkable story. He offers counselling on a voluntary basis to some Non-Profit Organisations and hospitals by referral. He also spends time with terminally-ill patients, sharing with them his experiences and advocating self-accountability, self-healing awareness and the healing connection which complements main stream medical treatment.</p>\r\n	<p>\r\n		During the later phase of his recovery, John did extensive research on the sector he works in. Besides the holistic understanding of Water, Nutrition, Environment, Energetics and one&#39;s Mental state that have a profound impact on a person&#39;s health, he discovered that there is a deeper aspect to each of these areas. These are discreetly revealed in his best seller book &quot;Awaken Your Healing Power&quot;, backed by scientific findings and discussions.</p>\r\n	<p>\r\n		John is a scientific professioal with a background in Molecular Genetics and Biotechnology. He was trained in Bio-Analytical Chemistry for Mass Spectrometry and Bio-Safety in USA. He has been involved with the research and regulatory sector in South East Asia since 1997, researching biomedical and tropical diseases and consulting with top government agencies in Singapore and the region. Since 2000, he has been engaged in some of the pioneering work and studies using the most advanced mass spectrometry technologies for sectors like Food Safety Screening, Environmental Screening, Health Products Screening, Disease Markers, Natural Products Screening and Pharmaceutical Drug Development in SEA. He was also involved in the pioneering days of introducing Bio-Safety Practice in SEA.</p>\r\n	<p>\r\n		Although scientifically inclined by training, John has always loved to support, learn and work with Practitioners, Healers and Researchers in Naturopathy and other Alternative Healing Therapies. He marvels at the infinite potential of humans and the varieties of healing arts. He believes all the beautiful forms of healing come from one profound source.</p>\r\n	<p>\r\n		John serves as a consultant to various wellness organisations. He is a frequent speaker in various schools, VWOs and NGOs on the latest insights and trends on Food, Water and Environmental Safety where Mass Spectrometry is a concern for more than a decade. He is a strong believer in Psychosomatic Science and Quantum Energy Theories where the body is capable of spontaneously healing itself.</p>\r\n	<p>\r\n		<strong open=\"\" style=\"color:#7a7a7b; text-transform:uppercase; font-size:25px; font-family: \'Open Sans\'; \">Testimonials</strong></p>\r\n	<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" style=\"width: 100%;\">\r\n		<tbody>\r\n			<tr>\r\n				<td colspan=\"2\" open=\"\" style=\"text-transform:uppercase; color:#959595; font-family: \'Open Sans\'; font-size:25px; padding:0 0 10px 0;\">\r\n					DR VINCENT TAN</td>\r\n			</tr>\r\n			<tr>\r\n				<td style=\"width: 50px;\">\r\n					<img alt=\"\" src=\"images/icon_quote.png\" style=\"width: 65px; height: 50px;\" /></td>\r\n				<td style=\"color:#656565; font-style: italic;\">\r\n					John proved himself to be a miracle maker when my mom was admitted to the hospital on the brink of death. Through his inputs, my mom made a miraculous recovery that left the managing doctors dumbfounded. John is truly a giver and I am thankful and extremely blessed to have been touched and influenced by his amazing work.</td>\r\n			</tr>\r\n			<tr>\r\n				<td align=\"right\" colspan=\"2\" style=\"text-transform:uppercase; font-family: \'Open Sans\'; \">\r\n					<div>\r\n						DR VINCENT TAN <span style=\"color:#7c85fa\">MBBS, MRCS, MMED (Surgery)</span></div>\r\n				</td>\r\n			</tr>\r\n		</tbody>\r\n	</table>\r\n	<p>\r\n		&nbsp;</p>\r\n	<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" style=\"width: 100%;\">\r\n		<tbody>\r\n			<tr>\r\n				<td colspan=\"2\" open=\"\" style=\"text-transform:uppercase; color:#959595; font-family: \'Open Sans\'; font-size:25px; padding:0 0 10px 0;\">\r\n					ISAAC KK LOONG</td>\r\n			</tr>\r\n			<tr>\r\n				<td style=\"width: 50px;\">\r\n					<img alt=\"\" src=\"images/icon_quote.png\" style=\"width: 65px; height: 50px;\" /></td>\r\n				<td style=\"color:#656565; font-style: italic;\">\r\n					Donna, my mother&#39;s friend collapsed with a pain in her stomach, and the virus got everywhere, critical stage in Dec/Jan. John taught the family how to awaken her when all the doctors gave nothing but datelines. Now she woke up and is back home! Thank you, John!</td>\r\n			</tr>\r\n			<tr>\r\n				<td align=\"right\" colspan=\"2\" style=\"text-transform:uppercase; font-family: \'Open Sans\'; \">\r\n					<div>\r\n						ISAAC KK LOONG, <span style=\"color:#7c85fa\">inventor, architect, London</span></div>\r\n				</td>\r\n			</tr>\r\n		</tbody>\r\n	</table>\r\n</div>\r\n<p>\r\n	&nbsp;</p>\r\n\";s:5:\"catid\";s:1:\"2\";s:10:\"created_by\";s:2:\"42\";s:16:\"created_by_alias\";s:0:\"\";s:8:\"modified\";s:19:\"2014-05-07 04:51:36\";s:11:\"modified_by\";s:2:\"42\";s:6:\"params\";O:9:\"JRegistry\":1:{s:7:\"\0*\0data\";O:8:\"stdClass\":69:{s:14:\"article_layout\";s:9:\"_:default\";s:10:\"show_title\";s:1:\"1\";s:11:\"link_titles\";s:1:\"1\";s:10:\"show_intro\";s:1:\"0\";s:13:\"show_category\";s:1:\"0\";s:13:\"link_category\";s:1:\"0\";s:20:\"show_parent_category\";s:1:\"0\";s:20:\"link_parent_category\";s:1:\"0\";s:11:\"show_author\";s:1:\"0\";s:11:\"link_author\";s:1:\"0\";s:16:\"show_create_date\";s:1:\"0\";s:16:\"show_modify_date\";s:1:\"0\";s:17:\"show_publish_date\";s:1:\"0\";s:20:\"show_item_navigation\";s:1:\"0\";s:9:\"show_vote\";s:1:\"0\";s:13:\"show_readmore\";s:1:\"1\";s:19:\"show_readmore_title\";s:1:\"0\";s:14:\"readmore_limit\";s:3:\"100\";s:10:\"show_icons\";s:1:\"0\";s:15:\"show_print_icon\";s:1:\"0\";s:15:\"show_email_icon\";s:1:\"0\";s:9:\"show_hits\";s:1:\"0\";s:11:\"show_noauth\";s:1:\"0\";s:13:\"urls_position\";s:1:\"0\";s:23:\"show_publishing_options\"