ks. The Course is an eye opener, because it explains \"energy\" from the quantum physics point of view, yet it\'s not difficult to understand for those who do not have a science background. After attending the course, I feel more grounded and confident during Reiki healing sessions, because I know exactly what is happening. If you are interested in energy healing, I highly recommend this course........The transformation was not obvious until 3 months later. Friends noticed my face started glowing, and my Qigong master said the Qi flow is much better than before. It doesn\'t matter whether you have any problem or not, knowledge about the five elements will definitely enhance your quality of life. DR VINCENT TAN MBBS, MRCS, MMED (Surgery)\";s:9:\"published\";N;s:5:\"state\";i:1;s:6:\"access\";s:1:\"1\";s:8:\"language\";s:1:\"*\";s:18:\"publish_start_date\";s:19:\"2014-05-07 07:32:02\";s:16:\"publish_end_date\";s:19:\"0000-00-00 00:00:00\";s:10:\"start_date\";s:19:\"2014-05-07 07:32:02\";s:8:\"end_date\";s:19:\"0000-00-00 00:00:00\";s:10:\"list_price\";N;s:10:\"sale_price\";N;s:7:\"type_id\";i:3;}'),(93,'index.php?option=com_content&view=article&id=11','index.php?option=com_content&view=article&id=11:chong-fook-weng&catid=7:testimonials&Itemid=114','Chong fook weng','Scientific Proof on spirituality, healing & metaphysics gave me the strongest impact! Chong Fook Weng, co-founder of Fengshui and Bazhi school','2014-05-07 16:04:24','01b1152700be5a7b4cb57c1fc86e0d59',1,1,1,'*','2014-05-07 08:02:38','0000-00-00 00:00:00','2014-05-07 08:02:38','0000-00-00 00:00:00',0,0,3,'O:19:\"FinderIndexerResult\":18:{s:11:\"\0*\0elements\";a:24:{s:2:\"id\";s:2:\"11\";s:5:\"alias\";s:15:\"chong-fook-weng\";s:7:\"summary\";s:628:\"<div>\r\n	<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" style=\"width: 100%;\">\r\n		<tbody>\r\n			<tr>\r\n				<td style=\"width: 50px;\" valign=\"top\">\r\n					<img alt=\"\" src=\"images/icon_quote.png\" style=\"width: 65px; height: 50px;\" /></td>\r