8:27','254c1c9f6e7922ad08f7f3cac31deb4f',1,1,1,'*','2014-05-07 10:08:27','0000-00-00 00:00:00','2014-05-07 10:08:27','0000-00-00 00:00:00',0,0,3,'O:19:\"FinderIndexerResult\":18:{s:11:\"\0*\0elements\";a:24:{s:2:\"id\";s:2:\"17\";s:5:\"alias\";s:11:\"dr-mel-gill\";s:7:\"summary\";s:1215:\"<div>\r\n	<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" style=\"width: 100%;\">\r\n		<tbody>\r\n			<tr>\r\n				<td style=\"width: 50px;\" valign=\"top\">\r\n					<img alt=\"\" src=\"images/icon_quote.png\" style=\"width: 65px; height: 50px;\" /></td>\r\n				<td style=\"color: rgb(101, 101, 101); font-style: italic;\">\r\n					This book is an eye-opener! Just when we thought we had seen it all with books like Lynne McTaggart&rsquo;s The Field and Rupert Sheldrake&rsquo;s Seven Experiments That Could Change the World, along comes the exciting and scientifically-backed account of people like John Wong, who defied the odds and went against conventional medical wisdom to emerge triumphant in a face-off with death. A must-read for those who wish to keep in good health and maintain their vitality, youth and vigor by simply changing the way they see the world around them. This book has reminded me that all of life, including my body, is a spectacular miracle. I highly recommend this book!</td>\r\n			</tr>\r\n			<tr>\r\n				<td align=\"right\" colspan=\"2\" style=\"font-weight: bold;\">\r\n					DR MEL GILL, <span style=\"color:#7c85fa\">author of the international bestseller The Meta Secret</span></td>\r\n			</tr>\r\n		</tbody>\r\n	</table>\r\n</div>\r\n\";s:4:\"body\";s:0:\"\";s:5:\"catid\";s:1:\"7\";s:10:\"created_by\";s:2:\"42\";s:16:\"created_by_alias\";s:0:\"\";s:8:\"modified\";s:19:\"0000-00-00 00:00:00\";s:11:\"modified_by\";s:1:\"0\";s:6:\"params\";O:9:\"JRegistry\":1:{s:7:\"\0*\0data\";O:8:\"stdClass\":69:{s:14:\"article_layout\";s:9:\"_:default\";s:10:\"show_title\";s:1:\"1\";s:11:\"link_titles\";s:1:\"1\";s:10:\"show_intro\";s:1:\"0\";s:13:\"show_category\";s:1:\"0\";s: