ser\";s:7:\"summary\";s:1177:\"<div>\r\n	<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" style=\"width: 100%;\">\r\n		<tbody>\r\n			<tr>\r\n				<td style=\"width: 50px;\" valign=\"top\">\r\n					<img alt=\"\" src=\"images/icon_quote.png\" style=\"width: 65px; height: 50px;\" /></td>\r\n				<td style=\"color: rgb(101, 101, 101); font-style: italic;\">\r\n					I had severe pain in my neck and numbness down my right arm that worsened over a 3 year period until I could no longer tolerate it and consulted an osteopath and 2 neurosurgeons. MRI showed 2 slipped disks and calcification that pinched off the nerves. All said neck surgery is mandatory to recover. I was inspired by your talks at Kampung Senang and I read your book. I decided to take responsibility for myself and visualize that I heal myself. Soon after I started, my pain and numbness diminished to zero. It&#39;s been 3 continuous months without pain. Next year I plan another MRI to see if there is measurable physical improvement. Thank you for inspiring me to heal myself.</td>\r\n			</tr>\r\n			<tr>\r\n				<td align=\"right\" colspan=\"2\" style=\"font-weight: bold;\">\r\n					Wes Heiser, <span style=\"color:#7c85fa\">USA</span></td>\r\n			</tr>\r\n		</tbody>\r\n	</table>\r\n</div>\r\n\";s:4:\"body\";s:0:\"\";s:5:\"catid\";s:1:\"7\";s:10:\"created_by\";s:2:\"42\";s:16:\"created_by_alias\";s:0:\"\";s:8:\"modified\";s:19:\"0000-00-00 00:00:00\";s:11:\"modified_by\";s:1:\"0\";s:6:\"params\";O:9:\"JRegistry\":1:{s:7:\"\0*\0data\";O:8:\"stdClass\":69:{s:14:\"article_layout\";s:9:\"_:default\";s:10:\"show_title\";s:1:\"1\";s:11:\"link_titles\";s:1:\"1\";s:10:\"show_intro\";s:1:\"0\";s:13:\"show_category\";s:1:\"0\";s:13:\"link_category\";s:1:\"0\";s:20:\"show_parent_category\";s:1:\"0\";s:20:\"link_parent_category\";s:1:\"0\";s:11:\"show_author\";s:1:\"0\";s:11:\"link_author\";s:1:\"0\";s:16:\"show_create_date\";s:1:\"0\";s:16:\"show_modify_date\";s:1:\"0\";s:17:\"show_publish_date\";s:1:\"0\";s:20:\"show_ite