ear period until I could no longer tolerate it and consulted an osteopath and 2 neurosurgeons. MRI showed 2 slipped disks and calcification that pinched off the nerves. All said neck surgery is mandatory to recover. I was inspired by your talks at Kampung Senang and I read your book. I decided to take responsibility for myself and visualize that I heal myself. Soon after I started, my pain and numbness diminished to zero. It\'s been 3 continuous months without pain. Next year I plan another MRI to see if there is measurable physical improvement. Thank you for inspiring me to heal myself. Wes Heiser, USA\";s:9:\"published\";N;s:5:\"state\";i:1;s:6:\"access\";s:1:\"1\";s:8:\"language\";s:1:\"*\";s:18:\"publish_start_date\";s:19:\"2014-05-07 10:10:21\";s:16:\"publish_end_date\";s:19:\"0000-00-00 00:00:00\";s:10:\"start_date\";s:19:\"2014-05-07 10:10:21\";s:8:\"end_date\";s:19:\"0000-00-00 00:00:00\";s:10:\"list_price\";N;s:10:\"sale_price\";N;s:7:\"type_id\";i:3;}'),(100,'index.php?option=com_content&view=article&id=19','index.php?option=com_content&view=article&id=19:stephanie-milani-theng&catid=7:testimonials&Itemid=114','Stephanie milani theng','One word to sum up my feelings so far: wow. I am shocked. You\'ve described your Experiences and ordeals SO vividly and honestly... Its hard not to get absorbed and to think abt how and what happened when such an illness is so intimate... Thank you for you','2014-05-07 18:12:16','b0d79306385484b1b47eba0812986956',1,1,1,'*','2014-05-07 10:12:16','0000-00-00 00:00:00','2014-05-07 10:12:16','0000-00-00 00:00:00',0,0,3,'O:19:\"FinderIndexerResult\":18:{s:11:\"\0*\0elements\";a:24:{s:2:\"id\";s:2:\"19\";s:5:\"alias\";s:22:\"stephanie-milani-theng\";s:7:\"summary\";s:830:\"<div>\r\n	<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" style=\"width: 100%;\">\r\n		<tbody>\r\n			<tr>\r\n				<td style=\"width: 50px;\" valign=\"top\">\r\n					<img alt=\"\" src=\"images/icon_quote.png\" style=\"width: 65px; height: 50px;\" /></td>\r\n				<td style=\"color: rgb(101, 101, 101); font-style: italic;\">\r\n					One word to sum up my feelings so far: wow. I am shocked. You&#39;ve described your Experiences and ordeals SO vividly and honestly... Its hard not to get absorbed and to think abt how and what happened when such an illness is so intimate... Thank you for your courage and in sharing with us. Thanks for being real.</td>\r\n			</tr>\r\n			<tr>\r\n				<td align=\"right\" colspan=\"2\" style=\"font-weight: bold;\">\r\n					Stephanie Milani Theng, <span style=\"color:#7c85fa\"> Indoneisa</span></td>\r\n			</tr>\r\n		</tbody>\r\n	</table>\r\n</div>\r\n\";s:4:\"body\";s:0:\"\";s:5:\"catid\";s:1:\"7\";s:10:\"created_by\";s:2:\"42\";s:16:\"created_by_alias\";s:0:\"\";s:8:\"modified\";s:19:\"0000-00-00 00:00:00\";s:11:\"modified_by\";s:1:\"0\";s:6:\"params\";O:9:\"JRegistry\":1:{s:7:\"\0*\0data\";O:8:\"stdClass\":69:{s:14:\"article_layout\";s:9:\"_:default\";s:10:\"show_title\";s:1:\"1\";s:11:\"link_titles\";s:1:\"1\";s:10:\"show_intro\";s:1:\"0\";s:13:\"show_category\";s:1:\"0\";s:13:\"link_category\";s:1:\"0\";s:20:\"show_parent_category\";s:1:\"0\";s:20:\"link_parent_category\";s:1:\"0\";s:11:\"show_author\";s:1:\"0\";s:11:\"link_author\";s:1:\"0\";s:16:\"show_create_date\";s:1:\"0\";s:16:\"show_modify_date\";s:1:\"0\";s:17:\"show_publish_date\";s:1:\"0\";s:20:\"show_item_navigation\";s:1:\"0\";s:9:\"show_vote\";s:1:\"0\";s:13:\"show_readmore\";s:1:\"1\";s:19:\"show_readmore_title\";s:1:\"0\";s:14:\"readmore_limit\";s:3:\"100\";s:10:\"show_icons\";s:1:\"0\";s:15:\"show_print_icon\";s:1:\"0\";s:15:\"show_email_icon\";s:1:\"0\";s:9:\"show_hits\";s:1:\"0\";s:11:\"show_noauth\";s:1:\"0\";s:13:\"urls_position\";s:1:\"0\";s:23:\"show_publishing_options\";s:1:\"1\";s:20:\"show_article_options\";s:1:\"1\";s:25:\"show_urls_images_frontend\";s:1:\"1\";s:24:\"show_urls_images_backend\";s:1:\"1\";s:7:\"targeta\";i:0;s:7:\"targetb\";i:0;s:7:\"targetc\";i:0;s:11:\"float_intro\";s:5:\"right\";s:14:\"float_fulltex