2:\"Testimonials\";O:7:\"JObject\":4:{s:10:\"\0*\0_errors\";a:0:{}s:5:\"title\";s:12:\"Testimonials\";s:5:\"state\";i:1;s:6:\"access\";i:1;}}s:8:\"Language\";a:1:{s:1:\"*\";O:7:\"JObject\":4:{s:10:\"\0*\0_errors\";a:0:{}s:5:\"title\";s:1:\"*\";s:5:\"state\";i:1;s:6:\"access\";i:1;}}}s:3:\"url\";s:47:\"index.php?option=com_content&view=article&id=20\";s:5:\"route\";s:88:\"index.php?option=com_content&view=article&id=20:shan-lim&catid=7:testimonials&Itemid=114\";s:5:\"title\";s:8:\"Shan lim\";s:11:\"description\";s:578:\"When my father was warded in the hospital for a heart attack, I called John and asked him what I could do on my part to help my father. John shared that I could help my father by praying for his life energy to increase. Fortunately, I heeded John’s advice and my father’s condition did indeed improve. I strongly believe that having faith in prayers gave my family and me the extra boost that we needed. John’s sharing on how we should pray from the heart continues to make a difference in our lives. SHAN LIM, author of How Do Ordinary People Achieve Extraordinary Dreams\";s:9:\"published\";N;s:5:\"state\";i:1;s:6:\"access\";s:1:\"1\";s:8:\"language\";s:1:\"*\";s:18:\"publish_start_date\";s:19:\"2014-05-07 10:13:32\";s:16:\"publish_end_date\";s:19:\"0000-00-00 00:00:00\";s:10:\"start_date\";s:19:\"2014-05-07 10:13:32\";s:8:\"end_date\";s:19:\"0000-00-00 00:00:00\";s:10:\"list_price\";N;s:10:\"sale_price\";N;s:7:\"type_id\";i:3;}'),(102,'index.php?option=com_content&view=article&id=21','index.php?option=com_content&view=article&id=21:betty-l-khoo-kingsley&catid=7:testimonials&Itemid=114','Betty l khoo-kingsley','John Wong has written the most important book I have read this decade. Why? Because John’s experience reveals/affirms that the root of all illnesses begins in the mind…his young mind was filled with anger and resentment which boiled over to acts of violen','2014-05-07 18:15:07','a057955e28c2150d31913a2d9d854ece',1,1,1,'*','2014-05-07 10:15:07','0000-00-00 00:00:00','2014-05-07 10:15:07','0000-00-00 00:00:00',0,0,3,'O:19:\"FinderIndexerResult\":18:{s:11:\"\0*\0elements\";a:24:{s:2:\"id\";s:2:\"21\";s:5:\"alias\";s:21:\"betty-l-khoo-kingsley\";s:7:\"summary\";s:2520:\"<div>\r\n	<p>\r\n		<strong>John Wong has written the most important book I have read this decade.</strong></p>\r\n	<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" style=\"width: 100%;\">\r\n		<tbody>\r\n			<tr>\r\n				<td style=\"width: 50px;\" valign=\"top\">\r\n					<img alt=\"\" src=\"images/icon_quote.png\" style=\"width: 65px; height: 50px;\" /></td>\r\n				<td style=\"color: rgb(101, 101, 101); font-style: italic;\">\r\n					Why? Because John&rsquo;s experience reveals/affirms that the root of all illnesses begins in the mind&hellip;his young mind was filled with anger and resentment which boiled over to acts of violence. Then, as John entered his 30s, his angst &amp; ambition, coupled with his relentless drive to succeed in his bio-medical career, led to his paralysis and blindness. His body simply shut down. The medical experts in Singapore&rsquo;s General Hospital were completely baffled. They treated him blindly &ndash; even giving him chemotherapy &ndash; in the end they told John that there was nothing medical science could do for him. Only a miracle could make him walk and see again. And John created his own Miracle! In his darkest hours John made what he calls a &lsquo;Transcendental Connection&reg;&rsquo; with his Creator (the God source) by &ldquo;going within&rdquo;&hellip;Since hope of healing from without (i.e doctors &amp; drugs) was gone, he was forced to fall back on himself. With a body emanciated and crumpled with pain, John had only his mind to journey within. As he began soul-searching, probing deep within, he realized the pain and hurt he had caused his parents&hellip;and he was truly penitent. Bingo! that was the breakthrough&hellip;just as his sickness had been caused by his anger &amp; ambition filled mind, now his genuine remorse was triggering healing in every cell. And, just as importantly, as John turned the corner, he vowed that he would use his experience to help others who are suffering and to repay his parents for their unwavering care and faith in him. He had found his purpose for recovery&hellip; And this book tells very heart-warming stories of the people he started helping, even as he himself was struggling to regain his full strength. There are vitally important lessons for all of us in John&rsquo;s story.</td>\r\n			</tr>\r\n			<tr>\r\n				<td align=\"right\" colspan=\"2\" style=\"font-weight: bold;\">\r\n					Betty L Khoo-Kingsley, <span style=\"color:#7c85fa\"> Author: Cancer Cured &amp; Prevented, Naturally (3rd edition)</span></td>\r\n			</tr>\r\n		</tbody>\r\n	</table>\r\n</div>\r\n\";s:4:\"body\";s:0:\"\";s:5:\"catid\";s:1:\"7\";s:10:\"created_by\";s:2:\"42\";s:16:\"created_by_alias\";s:0:\"\";s:8:\"modified\";s:19:\"0000-00-00 00:00:00\";s:11:\"modified_by\";s:1:\"0\";s:6:\"params\";O:9:\"JRegistry\":1:{s:7:\"\0*\0data\";O:8:\"stdClass\":69:{s:14:\"article_layout\";s:9:\"_:default\";s:10:\"show_title\";s:1:\"1\";s:11:\"link_titles\";s:1:\"1\";s:10:\"show_intro\";s:1:\"0\";s:13:\"show_category\";s:1:\"0\";s:13:\"link_category\";s:1:\"0\";s:20:\"show_parent_category\";s:1:\"0\";s:20:\"link_parent_category\";s:1:\"0\";s:11:\"show_author\";s:1:\"0\";s:11:\"link_author\";s:1:\"0\";s:16:\"show_create_date\";s:1:\"0\";s:16:\"show_modify_date\";s:1:\"0\";s:17:\"show_publish_date\";s:1:\"0\";s:20:\"show_item_navigation\";s:1:\"0\";s:9:\"show_vote\";s:1:\"0\";s:13:\"show_readmore\";s:1:\"1\";s:19:\"show_readmore_title\";s:1:\"0\";s:14:\"readmore_limit\";s:3:\"100\";s:10:\"show_icons\";s:1:\"0\";s:15:\"show_print_icon\";s:1:\"0\";s:15:\"show_email_icon\";s:1:\"0\";s:9:\"show_hits\";s:1:\"0\";s:11:\"show_noauth\";s:1:\"0\";s:13:\"urls_position\";s:1:\"0\";s:23:\"show_publishing_options\";s:1:\"1\";s:20:\"show_article_options\";s:1:\"1\";s:25:\"show_urls_images_fr