monials\";s:6:\"author\";s:10:\"Super User\";s:6:\"layout\";s:7:\"article\";s:4:\"path\";s:52:\"testimonials/7-testimonials/21-betty-l-khoo-kingsley\";s:10:\"metaauthor\";N;}s:15:\"\0*\0instructions\";a:5:{i:1;a:3:{i:0;s:5:\"title\";i:1;s:8:\"subtitle\";i:2;s:2:\"id\";}i:2;a:2:{i:0;s:7:\"summary\";i:1;s:4:\"body\";}i:3;a:8:{i:0;s:4:\"meta\";i:1;s:10:\"list_price\";i:2;s:10:\"sale_price\";i:3;s:7:\"metakey\";i:4;s:8:\"metadesc\";i:5;s:10:\"metaauthor\";i:6;s:6:\"author\";i:7;s:16:\"created_by_alias\";}i:4;a:2:{i:0;s:4:\"path\";i:1;s:5:\"alias\";}i:5;a:1:{i:0;s:8:\"comments\";}}s:11:\"\0*\0taxonomy\";a:4:{s:4:\"Type\";a:1:{s:7:\"Article\";O:7:\"JObject\":4:{s:10:\"\0*\0_errors\";a:0:{}s:5:\"title\";s:7:\"Article\";s:5:\"state\";i:1;s:6:\"access\";i:1;}}s:6:\"Author\";a:1:{s:10:\"Super User\";O:7:\"JObject\":4:{s:10:\"\0*\0_errors\";a:0:{}s:5:\"title\";s:10:\"Super User\";s:5:\"state\";i:1;s:6:\"access\";i:1;}}s:8:\"Category\";a:1:{s:12:\"Testimonials\";O:7:\"JObject\":4:{s:10:\"\0*\0_errors\";a:0:{}s:5:\"title\";s:12:\"Testimonials\";s:5:\"state\";i:1;s:6:\"access\";i:1;}}s:8:\"Language\";a:1:{s:1:\"*\";O:7:\"JObject\":4:{s:10:\"\0*\0_errors\";a:0:{}s:5:\"title\";s:1:\"*\";s:5:\"state\";i:1;s:6:\"access\";i:1;}}}s:3:\"url\";s:47:\"index.php?option=com_content&view=article&id=21\";s:5:\"route\";s:101:\"index.php?option=com_content&view=article&id=21:betty-l-khoo-kingsley&catid=7:testimonials&Itemid=114\";s:5:\"title\";s:21:\"Betty l khoo-kingsley\";s:11:\"description\";s:1928:\"John Wong has written the most important book I have read this decade. Why? Because John’s experience reveals/affirms that the root of all illnesses begins in the mind…his young mind was filled with anger and resentment which boiled over to acts of violence. Then, as John entered his 30s, his angst & ambition, coupled with his relentless drive to succeed in his bio-medical career, led to his paralysis and blindness. His body simply shut down. The medical experts in Singapore’s General Hospital were completely baffled. They treated him blindly – even giving him chemotherapy – in the end they told John that there was nothing medical science could do for him. Only a miracle could make him walk and see again. And John created his own Miracle! In his darkest hours John made what he calls a ‘Transcendental Connection®’ with his Creator (the God source) by “going within”…Since hope of healing from without (i.e doctors & drugs) was gone, he was forced to fall back on himself. With a body emanciated and crumpled with pain, John had only his mind to journey within. As he began soul-searching, probing deep within, he realized the pain and hurt he had caused his parents…and he was truly penitent. Bingo! that was the breakthrough…just as his sickness had been caused by his anger & ambition filled mind, now his genuine remorse was triggering healing in every cell. And, just as importantly, as John turned the corner, he vowed that he would use his experience to help others who are suffering and to repay his parents for their unwavering care and faith in him. He had found his purpose for recovery… Andthis book tells very heart-warming stories of the people he started helping, even as he himself was struggling to regain his full strength. There are vitally important lessons for all of us in John’s story. Betty L Khoo-Kingsley, Author: Cancer Cured & Prevented, Naturally (3rd edition)\";s:9:\"published\";N;s:5:\"state\";i:1;s:6:\"access\";s:1:\"1\";s:8:\"language\";s:1:\"*\";s:18:\"publish_start_date\";s:19:\"2014-05-07 10:15:07\";s:16:\"publish_end_date\";s:19:\"0000-00-00 00:00:00\";s:10:\"start_date\";s:19:\"2014-05-07 10:15:07\";s:8:\"end_date\";s:19:\"0000-00-00 00:00:00\";s:10:\"list_price\";N;s:10:\"sale_price\";N;s:7:\"type_id\";i:3;}'),(103,'index.php?option=com_content&view=article&id=22','index.php?option=com_content&view=article&id=22:dr-chua-teck-mean&catid=7:testimonials&Itemid=114','Dr chua teck-mean','The human body is a masterpiece of God’s creation that ha