om_content&view=article&id=24\";s:5:\"route\";s:94:\"index.php?option=com_content&view=article&id=24:isaac-kk-loong&catid=7:testimonials&Itemid=114\";s:5:\"title\";s:14:\"Isaac kk loong\";s:11:\"description\";s:308:\"Donna, my mother’s friend collapsed with a pain in her stomach, and the virus got everywhere, critical stage in Dec/ Jan, John taught the family how to awaken her when all the doctors gave nothing but datelines. Now she woke up and is back home! Thank you, John! ISAAC KK LOONG, inventor, architect, London\";s:9:\"published\";N;s:5:\"state\";i:1;s:6:\"access\";s:1:\"1\";s:8:\"language\";s:1:\"*\";s:18:\"publish_start_date\";s:19:\"2014-05-07 10:18:54\";s:16:\"publish_end_date\";s:19:\"0000-00-00 00:00:00\";s:10:\"start_date\";s:19:\"2014-05-07 10:18:54\";s:8:\"end_date\";s:19:\"0000-00-00 00:00:00\";s:10:\"list_price\";N;s:10:\"sale_price\";N;s:7:\"type_id\";i:3;}'),(106,'index.php?option=com_content&view=article&id=25','index.php?option=com_content&view=article&id=25:chris-yang&catid=7:testimonials&Itemid=114','Chris yang','Awaken Your Healing Power brings you on a personal journey together with John Wong as he accounts his intimate life journey to the crux of his very existence. At breaking point, where his mind was the only piece of dignity strapped over his forsaken body,','2014-05-07 18:20:00','46498c929ecca63ce25038caf5301d24',1,1,1,'*','2014-05-07 10:20:00','0000-00-00 00:00:00','2014-05-07 10:20:00','0000-00-00 00:00:00',0,0,3,'O:19:\"FinderIndexerResult\":18:{s:11:\"\0*\0elements\";a:24:{s:2:\"id\";s:2:\"25\";s:5:\"alias\";s:10:\"chris-yang\";s:7:\"summary\";s:1431:\"<div>\r\n	<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" style=\"width: 100%;\">\r\n		<tbody>\r\n			<tr>\r\n				<td style=\"width: 50px;\" valign=\"top\">\r\n					<img alt=\"\" src=\"images/icon_quote.png\" style=\"width: 65px; height: 50px;\" /></td>\r\n				<td style=\"color: rgb(101, 101, 101); font-style: italic;\">\r\n					Awaken Your Healing Power brings you on a personal journey together with John Wong as he accounts his intimate life journey to the crux of his very existence. At breaking point, where his mind was the only piece of dignity strapped over his forsaken body, his true journey unravels itself as a personal and mental transformation over the physical state. From a world void of senses, John&#39;s seemingly miraculous reversal of paralysis and blindness brings greater and deeper insight than before. Similarly, the true journey herein for the reader starts from John&#39;s sharing of the first-hand details of his self-healing, including perspectives from a lay person to a scientist. This is an extraordinary compilation of diverse healing knowledge, proven to work, and from personal experience. A simply priceless read for those who seek and appreciate a connection with the inner self.</td>\r\n			</tr>\r\n			<tr>\r\n				<td align=\"right\" colspan=\"2\" style=\"font-weight: bold;\">\r\n					Dr Chris Yang, <span style=\"color:#7c85fa\">Cell Biologist, National Univeristy of Singapore</span></td>\r\n			</tr>\r\n		</tbody>\r\n	</table>\r\n</div>\r\n\";s:4:\"body\";s:0:\"\";s:5:\"catid\";s:1:\"7\";s:10:\"created_by\";s:2:\"42\";s:16:\"created_by_alias\";s:0:\"\";s:8:\"modified\";s:19:\"0000-00-00 00:00:00\";s:11:\"modified_by\";s:1:\"0\";s:6:\"params\";O:9:\"JRegistry\":1:{s:7:\"\0*\0data\";O:8:\"stdClass\":69:{s:14:\"article_layout\";s:9:\"_:default\";s:10:\"show_title\";s:1:\"1\";s:11:\"link_titles\";s:1:\"1\";s:10:\"show_intro\";s:1:\"0\";s:13:\"show_category\";s:1:\"0\";s:13:\"link_category\";s:1:\"0\";s:20:\"show_parent_category\";s:1:\"0\";s:20:\"link_parent_category\";s:1:\"0\";s:11:\"show_author\";s:1:\"0\";s:11:\"link_author\";s:1:\"0\";s:16:\"show_create_date\";s:1:\"0\";s:16:\"show_modify_date\";s:1:\"0\";s:17:\"show_publish_date\";s:1:\"0\";s:20:\"show_item_navigation\";s:1:\"0\";s:9:\"show_vote\";s:1:\"0\";s:13:\"show_readmore\";s:1:\"1\";s:19:\"show_readmore_title\";s:1:\"0\";s:14:\"readmore_limit\";s:3:\"100\";s