n		<a href=\"http://joomlackeditor.com/terms-of-use\">http://joomlackeditor.com/terms-of-use</a>\r\n		</div>\r\n		<div style=\"padding: 5px;\">\r\n		The JCK Manager is a way of effortlessly extending the JCK Editor without the need of programming knowledge! And because the Editor is built upon a state-of-the-art plug-and-play architecture you can expand it and shape it in any direction!\r\n			<br />\r\n			<br />\r\n		</div>',1,'jck_cpanel',0,'0000-00-00 00:00:00','0000-00-00 00:00:00','0000-00-00 00:00:00',1,'mod_custom',1,1,'{\"prepare_content\":0}',1,''),(121,'JCK Plugin Manager - (FAQs)','','<div style=\"padding: 5px;\">\r\n			<img alt=\"\" src=\"components/com_jckman/icons/icon-48-plugin.png\" style=\"float: left; margin: 3px 2px 0pt 0pt;\" />The Plugin Manager controls what buttons are displayed in the editor&rsquo;s interface. It allows plugins to be published, unpublished, and assigned to specific tool-bars with the ability to setup user permissions.<br/> <br/> \r\n			In addition to these great features the Plugin Manager will also allow you to define three default parameters for the dialog popup screens: Height, Title and Width. And if this was not enough you can add further customizable options for your JCK plugins as parameters are just like any standard Joomla extensions! \r\n			<br />\r\n			<br />\r\n		</div>',2,'jck_cpanel',0,'0000-00-00 00:00:00','0000-00-00 00:00:00','0000-00-00 00:00:00',1,'mod_custom',1,1,'{\"prepare_content\":0}',1,''),(122,'JCK Plugin Installer - (FAQs)','','<div style=\"padding: 5px;\">\r\n			<img alt=\"\" src=\"components/com_jckman/icons/icon-48-installer.png\" style=\"float: left; margin: 3px 2px 0pt 0pt;\" />The Plugin installer allows you to install and uninstall JCK plugins. A JCK plugin consists of an extension that interacts with the editor. These plugins or extensions are used to enable the user to quickly and simply customise or expand the functionality of the editor. This could be done to meet your needs to portfolio images in a stylish gallery light-box or to expand the editor with media or image editing extensions. The possibilities are endless!\r\n		<br />\r\n		</div>\r\n		<div style=\"padding: 5px;\">\r\n		Please click here to visit the official Plug-in Store: <a href=\"http://www.joomlackeditor.com/ckeditor-plugins-repository\">http://www.joomlackeditor.com/ckeditor-plugins-repository </a>\r\n		<br />\r\n		<br />\r\n		</div>',3,'jck_cpanel',0,'0000-00-00 00:00:00','0000-00-00 00:00:00','0000-00-00 00:00:00',1,'mod_custom',1,1,'{\"prepare_content\":0}',1,''),(123,'System Check - (FAQs)','','<div style=\"padding: 5px;\">\r\n			<img alt=\"\" src=\"components/com_jckman/icons/icon-48-systemcheck.png\" style=\"float: left; margin: 3px 2px 0pt 0pt;\" />The manager has an intelligent API that will work to rectify any server-side file permissions which is required for the editor to upload and administer files.  It does this by automatically performing a health check on your system and notifies you of these problems and will try to fix them for you.\r\n		<br />\r\n		</div>\r\n		<div style=\"padding: 5px;\">\r\n		This also reinitiates the helpful installation wizard which will walk you step by step through the process of setting up the basic functionally of the editor. This is done to help you get the best of the JCK Editor! \r\n		<br />\r\n		<br />\r\n		</div>',4,'jck_cpanel',0,'0000-00-00 00:00:00','0000-00-00 00:00:00','0000-00-00 00:00:00',1,'mod_custom',1,1,'{\"prepare_content\":0}',1,''),(124,'Layout Manager - (FAQs)','','<div style=\"padding: 5px;\">\r\n			<img alt=\"\" src=\"components/com_jckman/icons/icon-48-layout.png\" style=\"float: left; margin: 3px 2px 0pt 0pt;\" />It allows complete control over the editor&rsquo;s layout. You can create your own bespoke toolbars, position plugins, create new toolbars, publish and unpublish toolbars! It&rsquo;s surprisingly easy do thanks to its simple drag-and-drop interface. \r\n			<br />\r\n			<br />\r\n		</div>',5,'jck_cpanel',0,'0000-00-00 00:00:00','0000-00-00 00:00:00','0000-00-00 00:00:00',1,'mod_custom',1,1,'{\"prepare_content\":0}',1,''),(125,'Backup - (FAQs)','','<div style=\"padding: 5px;\">\r\n			<img alt=\"\" src=\"components/com_jckman/icons/icon-48-export.png\" style=\"float: left; margin: 3px 2px 0pt 0pt;\" /> The Backup wizard gives you the ability to create backup copies of your editor&rsquo;s configuration and files.  This includes backing up your JCK plugins and settings, your JCK Manager configuration (including toolbars and user permissions) and lastly your editor&rsquo;s configuration. It does this by creating a clone and exporting it as a tar.gz file ready for you to reinstate via the JCK Managers backup restore feature!\r\n		<br />\r\n		</div>\r\n		<div style=\"padding: 5px;\">\r\n		This feature is very useful, and can be used to export restore points prior to upgrading or used to export your custom configuration to another Joomla compatible system!\r\n		<br />\r\n		<br />\r\n		</div>',6,'jck_cpanel',0,'0000-00-00 00:00:00','0000-00-00 00:00:00','0000-00-00 00:00:00',1,'mod_custom',1,1,'{\"prepare_content\":0}',1,''),(126,'Restore - (FAQs)','','<div style=\"padding: 5px;\">\r\n			<img alt=\"\" src=\"components/com_jckman/icons/icon-48-import.png\" style=\"float: left; margin: 3px 2px 0pt 0pt;\" /> To restore a back it is very easy! All you need to do is click in the &lsquo;Restore&rsquo;s icon, navigate to the tar.gz backup file and click in the &lsquo;Upload File &amp; install&rsquo;s button. Or if you want to migrate your configuration from one server to another, all you need to do is install the JCK Editor &amp; Manager first, and repeat the above &ndash; job done!\r\n		</div>',7,'jck_cpanel',0,'0000-00-00 00:00:00','0000-00-00 00:00:00','0000-00-00 00:00:00',1,'mod_custom',1,1,'{\"prepare_content\":0}',1,''),(127,'Sync - (FAQs)','','<div style=\"padding: 5px;\">\r\n			<img alt=\"\" src=\"components/com_jckman/icons/icon-48-sync.png\" style=\"float: left; margin: 3px 2px 0pt 0pt;\" />The JCK Manager keeps a hard copy of your editor&rsquo;s settings and plugins. At any given moment you can use the &lsquo;Sync&rsquo; button to synchronize this data back to the JCK Editor. This is especially useful as it will allow you to uninstall and reinstall the editor during upgrade, before synchronizing your editor&rsquo;s settings back!\r\n		</div>',8,'jck_cpanel',0,'0000-00-00 00:00:00','0000-00-00 00:00:00','0000-00-00 00:00:00',1,'mod_custom',1,1,'{\"prepare_content\":0}',1,''),(128,'JCK PLugMan Control Panel Icons','','',1,'jck_icon',0,'0000-00-00 00:00:00','0000-00-00 00:00:00','0000-00-00 00:00:00',1,'mod_jckquickicon',1,0,'',1,''),(129,'Certification  Program','','',1,'content-top-a',0,'0000-00-00 00:00:00','0000-00-00 00:00:00','0000-00-00 00:00:00',1,'mod_fwarticle',1,1,'{\"article_id\":\"2\",\"Link\":\"\",\"moduleclass_sfx\":\"mod_certification\",\"ItemId\":\"118\"}',0,'*'),(130,'Founder','','',1,'content-top-b',0,'0000-00-00 00:00:00','0000-00-00 00:00:00','0000-00-00 00:00:00',1,'mod_fwarticle',1,1,'{\"article_id\":\"3\",\"Link\":\"\",\"moduleclass_sfx\":\"mod_founder\",\"ItemId\":\"116\"}',0,'*'),(131,'What is transcendental connection® ?','','<div>\r\n	<table border=\"0\" cellpadding=\"1\" cellspacing=\"1\" width=\"625px\">\r\n		<tbody>\r\n			<tr>\r\n				<td>\r\n					<div class=\"video\">\r\n						<object data=\"http://www.youtube.com/v/MOTC7bbD69A?fs=1&amp;hl=en_US&amp;autoplay=1\" height=\"245\" type=\"application/x-shockwave-flash\" width=\"300\"><param name=\"autoplay\" value=\"true\" /><param name=\"allowfullscreen\" value=\"true\" /><param name=\"movie\" value=\"http://www.youtube.com/v/MOTC7bbD69A?fs=1&amp;hl=en_US&amp;autoplay=1\" /></object></div>\r\n				</td>\r\n				<td width=\"20px\">\r\n					<div>\r\n						&nbsp;</div>\r\n				</td>\r\n				<td>\r\n					<div class=\"video\">\r\n						<object data=\"http://www.youtube.com/v/DLF_ZqEXPMg\" height=\"245\" type=\"application/x-shockwave-flash\" width=\"300\"><param name=\"a