INSERT INTO `y8nhj_rsform_forms` VALUES (3,'contact-us','<div id=\'wrap_contactus\'>\r\n	{error}\r\n	<div class=\'posleft\'>\r\n		<table class=\'tbl_frm_contact\'>\r\n			<tr>\r\n				<td class=\"formCaption\">{name:caption}<strong class=\"formRequired\">*</strong></td>\r\n				<td class=\"formBody\">{name:body}<span class=\"formClr\">{name:validation}</span></td>\r\n			</tr>\r\n			\r\n			<tr>\r\n				<td class=\"formCaption\">{email:caption}<strong class=\"formRequired\">*</strong></td>\r\n				<td class=\"formBody\">{email:body}<span class=\"formClr\">{email:validation}</span></td>\r\n			</tr>\r\n			\r\n			<tr>\r\n				<td class=\"formCaption\">{contact:caption}</td>\r\n				<td class=\"formBody\">{contact:body}<span class=\"formClr\">{contact:validation}</span></td>\r\n			</tr>\r\n			\r\n			<tr>\r\n				<td class=\"formCaption\">{message:caption}<strong class=\"formRequired\">*</strong></td>\r\n				<td class=\"formBody\">{message:body}<span class=\"formClr\">{message:validation}</span></td>\r\n			</tr>\r\n			\r\n			<tr>\r\n				\r\n				<td class=\"formBody\" colspan=\'2\' align=\'right\'>{captcha:body}<span class=\"formClr\">{captcha:validation}</span></td>\r\n			</tr>\r\n			\r\n			<tr>\r\n				<td></td>\r\n				<td align=\'right\'>{submit:body}</td>\r\n			</tr>\r\n		</table>\r\n	</div>\r\n	\r\n	<div class=\'posright\'>\r\n		<div class=\'google_map\'>\r\n			<iframe src=\"https://www.google.com/maps/embed?pb=!1m14!1m8!1m3!1d3988.761007959337!2d103.88276189999999!3d1.3190836000000001!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x31da1824feeb1ef5%3A0x146756d01a2d1329!2s106+Aljunied+Crescent!5e0!3m2!1svi!2s!4v1399427964187\" width=\"450\" height=\"265\" frameborder=\"0\" style=\"border:0\"></iframe>\r\n		</div>\r\n		<div class=\'info_address\'>\r\n			<div class=\'company\'>Transcendental Connection</div>\r\n			<div class=\'address\'>\r\n				106 Aljunied Crescent Singapore 380106. Office Admin Hour<br/>\r\n				Telephone : + 65 62747095 <br/>\r\n				Email: <span class=\'email\'>angie@transcendentalconnection.com</span> <br/>\r\n			</div>\r\n		</div>\r\n	</div>\r\n</div>\r\n','inline-xhtml',0,'','','Contact Us',1,1,'en-GB','',1,'<p>\r\n	Thank you for contacting us. We will get back to you as soon as possible.</p>',0,'<div>\r\n	Dear&nbsp;{name:value},</div>\r\n<div>\r\n	&nbsp;</div>\r\n<div>\r\n	Thank you for contacting us. We will get back to you as soon as possible.</div>\r\n<p>\r\n	&nbsp;</p>','{email:value}','','','ask@transcendentalconnection.com','','Transcendental Connection','Thank you for your submission!',1,0,'','<div>\r\n	Dear Admin,</div>\r\n<div>\r\n	&nbsp;</div>\r\n<div>\r\n	You have a new submission.</div>\r\n<div>\r\n	{name:caption}: {name:value}</div>\r\n<div>\r\n	{email:caption}: {email:value}</div>\r\n<div>\r\n	{contact:caption}: {contact:value}</div>\r\n<div>\r\n	{message:caption}:{message:value}</div>','ask@transcendentalconnection.com','','','ask@transcendentalconnection.com','','Transcendental Connection','New submission from \'Contact Us\'!',1,'','','','','','',0,'','','(*)','<p class=\"formRed\">Please complete all required fields!</p>','\\n',1,'','userForm','','','',0,'',1,0,0);
